const Display = (props)=>{
    return(
        <div>
            {props.data.map((shirt)=>(
                <div>
                    <li key={shirt.id}>
                        {shirt.name} - {shirt.size}*{shirt.price}
                    </li>
                </div>
            ))}
        </div>
    )
}
export default Display
